import React from 'react';

function List() {
    return (
        <ol>
            <li>The Flu</li>
            <li>Zombiesland</li>
            <li>World War</li>
            <li>Train to Bushan</li>
            <li>Train to Bushan2</li>
        </ol>
    );
}
export default List;
